import { AllPost } from '../Utilitaire/reducers/userActions';


const Home = () => {

	const user = useSelector((state) => state.authReducer.user);
	const posts = useSelector((state) => state.userReducer.post);


	useEffect(() => {
		dispatch(AllPost());
		console.log(posts);
	});

	return (
		<div id="HomeForm">
			<NavBarHome/>
			<div className="Post">
				<NewPost/>
				<Page/>
			</div>
		</div>
	)
}

export default Home;
